// ButtonContainer.js
import React from 'react';
import './page2emr.css';

const buttonNames = [
    'Seizure',
    {name:'Heart Attack'},
    'Stroke',
    'Choke',
    'Sugar',
    'Blood',
    'Asthma',
    'Broken Stuff',
];

function ButtonContainer() {
    const buttons = buttonNames.map((name, index) => (
        <button key={index} className="button">
            {name}
        </button>
    ));

    return (
        <div className="button-container">
            {buttons}
        </div>
    );
}

export default ButtonContainer;
